pub fn shaderAttrSlot(attr_name: []const u8) ?usize {
    if (std.mem.eql(u8, attr_name, "vertex_id")) {
        return 0;
    }
    if (std.mem.eql(u8, attr_name, "instance_id")) {
        return 1;
    }
    return null;
}
