pub fn shaderUniformBlockSlot(ub_name: []const u8) ?usize {
    if (std.mem.eql(u8, ub_name, "vs_params")) {
        return 0;
    }
    if (std.mem.eql(u8, ub_name, "fs_params")) {
        return 1;
    }
    return null;
}
pub fn shaderUniformBlockSize(ub_name: []const u8) ?usize {
    if (std.mem.eql(u8, ub_name, "vs_params")) {
        return @sizeOf(VsParams);
    }
    if (std.mem.eql(u8, ub_name, "fs_params")) {
        return @sizeOf(FsParams);
    }
    return null;
}
pub fn shaderUniformOffset(ub_name: []const u8, u_name: []const u8) ?usize {
    if (std.mem.eql(u8, ub_name, "vs_params")) {
        if (std.mem.eql(u8, u_name, "screen_size")) {
            return 0;
        }
    }
    if (std.mem.eql(u8, ub_name, "fs_params")) {
        if (std.mem.eql(u8, u_name, "time")) {
            return 0;
        }
        if (std.mem.eql(u8, u_name, "output_gamma")) {
            return 4;
        }
        if (std.mem.eql(u8, u_name, "text_unit_range")) {
            return 8;
        }
        if (std.mem.eql(u8, u_name, "text_in_bias")) {
            return 12;
        }
        if (std.mem.eql(u8, u_name, "text_out_bias")) {
            return 16;
        }
    }
    return null;
}
pub fn shaderUniformDesc(ub_name: []const u8, u_name: []const u8) ?sg.GlslShaderUniform {
    if (std.mem.eql(u8, ub_name, "vs_params")) {
        if (std.mem.eql(u8, u_name, "screen_size")) {
            var desc: sg.GlslShaderUniform = .{};
            desc.type = .FLOAT2;
            desc.array_count = 0;
